import Body from '../components/body'

class Main extends React.Component {

    state = {
        user: null
    }

    render() {

        return (
            <div className='grid-container'>
                <div className='Header'>
                    <h2> - Func(Flex) </h2>
                    <div className='menu-bar'>
                        <Menu />
                    </div>
                </div>
                    <div className='layout-center'>
                        <Body />
                    </div>
                    <div className='layout-right'>
                        <p> stuff here </p>
                    </div>
            </div>


        )
    }
}

export default Main;
